import React from 'react'
import ReactDom from 'react-dom'

function PlantList(){
  return(
    <section>
      <Plant/>
    </section>
  );
}

const Plant = () => {
  return( 
  <article>
    This is a plant
  </article> 
  );
}

const Image = () => <img src="https://i.pinimg.com/736x/ca/b4/73/cab473942dab3958ea156067e072ca28.jpg" alt=""/>


ReactDom.render(<PlantList/>, document.getElementById('root'));
